An idea for transports in RTS: manually loading units into transports is fuddly. Make it so that a transport is assigned a route (usually shortest connection, but can be waypoints or between ports only (meaning that the first trop would have to be coordinated manually), so that when units are assigned to travel over water, they will consider pathfinding from the starting point of that route. The ship will come and make as many back and forth trips until all of them have been shipped. Ofc, more than one ship can be assigned same route. 
























